import styled from "styled-components";
import Wrapper from "./Wrapper";
import { Link } from "react-router-dom";
const StyledHeader = styled.div`
  height: 60px;
  position: fixed;
  width: 100%;
  background-color: rgb(42, 39, 59);
  z-index: 120;
  .wrapper {
    position: relative;
    height: 100%;
    display: flex;
    align-items: center;
    justify-content: space-between;
    .search {
      flex: 1;
      width: 100%;
    }
  }

  .title {
    position: absolute;
    left: 0%;
    text-decoration: none;
    font-weight: blod;
    font-family: "Dongle", sans-serif;
    font-size: 20px;
    color: white;
  }

  .login {
    position: absolute;
    right: 7%;
    text-decoration: none;
    font-size: 20px;
    font-family: "Dongle", sans-serif;
    display: flex;
    //justify-content: flex-end;
    align-items: center;
    color: white;
  }

  .join {
    position: absolute;
    right: 0%;
    text-decoration: none;
    font-size: 20px;
    font-family: "Dongle", sans-serif;
    display: flex;
    align-items: center;
    color: white;
  }
`;

function Header() {
  return (
    <StyledHeader>
      <Wrapper className="wrapper">
        <Link className="title" to="/">
          WorldTone
        </Link>
        <Link className="login" to="/login">
          로그인
        </Link>
        <Link className="join" to="/join">
          회원가입
        </Link>
      </Wrapper>
    </StyledHeader>
  );
}
export default Header;
